import React, { useState } from "react";
import { Bar, BarChart, CartesianGrid, Legend, ResponsiveContainer, Tooltip, XAxis, YAxis } from "recharts";
import './FarmersDashboard.css';

const FarmersDashboard = () => {
  const [searchParams, setSearchParams] = useState({
    stateId: "",
    districtId: "",
    fpoId: "",
    cropId: "",
    farmerId: "",
  });

  const data = [
    { name: "Orman-01", farmerCount: 400 },
    { name: "Orman-01", farmerCount: 500 },
    { name: "Orman-01", farmerCount: 600 },
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setSearchParams({ ...searchParams, [name]: value });
  };

  const handleSearch = () => {
    // Implement search logic
    console.log("Search Params: ", searchParams);
  };

  return (
    <div className="dashboard-container">
      <header>
        <h1>Farmers Under Jurisdiction</h1>
      </header>

      <div className="inputs-section">
        <input
          type="text"
          name="stateId"
          placeholder="State id"
          value={searchParams.stateId}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="districtId"
          placeholder="District id"
          value={searchParams.districtId}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="fpoId"
          placeholder="FPO id"
          value={searchParams.fpoId}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="cropId"
          placeholder="Crop id"
          value={searchParams.cropId}
          onChange={handleInputChange}
        />
        <input
          type="text"
          name="farmerId"
          placeholder="Farmer id"
          value={searchParams.farmerId}
          onChange={handleInputChange}
        />
        <button onClick={handleSearch}>Search</button>
      </div>

      <div className="side-menu">
        <button>Yield Forecasts</button>
        <button className="active">Farmer's Under Jurisdiction</button>
        <button>Land Under Jurisdiction</button>
        <button>Marketing Insights</button>
        <button>Stakeholder Mgt.</button>
        <button>Farmer's Inputs</button>
        <button>Accounts</button>
      </div>

      <div className="chart-section">
        <h2>Farmer Count</h2>
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={data} margin={{ top: 20, right: 30, left: 20, bottom: 5 }}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="name" />
            <YAxis />
            <Tooltip />
            <Legend />
            <Bar dataKey="farmerCount" fill="#8B4513" />
          </BarChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
};

export default FarmersDashboard;
